import {Router} from 'express'
import * as userCtrl from '../controllers/user.controller'
import {authJwt, verifySignUp} from '../middlewares'

const router = Router()

router.post('/', [
    authJwt.verifyToken,
    authJwt.isAdmin,
    verifySignUp.checkRolesExisted
],userCtrl.createUser)

export default router;

